    // Upload files
    AudiosComponent.prototype.uploadFiles = function (type, event) {
        var convertToMb = function (bytes) {
            if (isNaN(parseFloat(bytes)) || !isFinite(bytes)) {
                return '-';
            }
            var units = ['bytes', 'kB', 'MB', 'GB', 'TB', 'PB'], number = Math.floor(Math.log(bytes) / Math.log(1024));
            return (bytes / Math.pow(1024, Math.floor(number))).toFixed(1) + ' ' + units[number];
        };
        if (type === 1) { // Add files
            for (var _i = 0, _a = event.currentTarget.files; _i < _a.length; _i++) {
                var file = _a[_i];
                if (file) {
                    file.title = file.name.replace('.mp3', '');
                    /* file.title = file.name; */
                    file.status = 'pending';
                    if (this.dataFiles.countUploads === 10) {
                        this.alertService.error(this.translations.common.exceededMaxUploads);
                    }
                    else {
                        /* if (file.type.indexOf('audio') > -1) { */
                        if (/^audio\/\w+$/.test(file.type)) {
                            file.category = 'audio';
                            if (file.size >= this.env.maxFileSize) {
                                file.sizeBig = convertToMb(file.size);
                                file.status = 'error';
                            }
                            this.dataFiles.list.unshift(file);
                        }
                        else {
                            file.category = 'unknown';
                            file.status = 'error';
                            this.dataFiles.list.unshift(file);
                        }
                    }
                }
            }
        }
        else if (type === 2) { // Cancel
            this.dataFiles.list = [];
        }
        else if (type === 3) { // Remove 1 by 1
            this.dataFiles.list.splice(event, 1);
        }
        else if (type === 4) { // Save & Upload
            if (this.dataFiles.list.length > this.env.maxItemsPerUpload) {
                this.alertService.success(this.translations.common.addedMoreElementsThanAllowed);
            }
            else {
                var checkUnknown = _.find(this.dataFiles.list, { 'category': 'unknown' });
                if (checkUnknown) {
                    this.alertService.error(this.translations.common.containsInvalidFiles);
                }
                else {
                    this.dataFiles.actions = false;
                    var self_1 = this;
                    var progressHandler_1 = function (ev, file) {
                        file.status = 'progress';
                        var percent = Math.round((ev.loaded / ev.total) * 100);
                        file.progress = Math.max(0, Math.min(100, percent));
                    };
                    var counterHandler_1 = function () {
                        self_1.dataFiles.counter = self_1.dataFiles.counter + 1;
                        self_1.dataFiles.reload = (self_1.dataFiles.list.length === self_1.dataFiles.counter) ? true : false;
                    };
                    var completeHandler_1 = function (ev, file) {
                        file.status = 'completed';
                        counterHandler_1();
                    };
                    var errorHandler_1 = function (ev, file) {
                        file.status = 'error';
                        counterHandler_1();
                    };
                    var abortHandler_1 = function (ev, file) {
                        file.status = 'error';
                        counterHandler_1();
                    };
                    var ajaxCall = function (file, formdata, ajax) {
                        formdata.append('fileUpload', file);
                        formdata.append('category', file.category);
                        formdata.append('title', file.title);
                        if (file.explicit) {
                            formdata.append('explicit', file.explicit);
                        }
                        ajax.upload.addEventListener('progress', function (ev) {
                            progressHandler_1(ev, file);
                        }, false);
                        ajax.addEventListener('load', function (ev) {
                            completeHandler_1(ev, file);
                        }, false);
                        ajax.addEventListener('error', function (ev) {
                            errorHandler_1(ev, file);
                        }, false);
                        ajax.addEventListener('abort', function (ev) {
                            abortHandler_1(ev, file);
                        }, false);
                        ajax.open('POST', './assets/api/audios/uploadFiles.php');
                        ajax.setRequestHeader('Authorization', self_1.sessionData.current.authorization);
                        ajax.send(formdata);
                    };
                    for (var i in this.dataFiles.list) {
                        if (i) {
                            if (!(this.dataFiles.list[i].category === 'unknown' || this.dataFiles.list[i].sizeBig)) {
                                this.dataFiles.list[i].status = 'progress';
                                var file = this.dataFiles.list[i], formdata = new FormData(), ajax = new XMLHttpRequest();
                                ajaxCall(file, formdata, ajax);
                            }
                        }
                    }
                }
            }
        }
        else if (type === 5) { // Reload
            this.data.selectedIndex = 1;
            this.default('default', this.sessionData.current.id);
            this.dataFiles = {
                list: [],
                reload: false,
                actions: true,
                saveDisabled: false,
                counter: 0
            };
        }
    };
