    // Play item song
    AudiosComponent.prototype.playSong = function (data, item, key, type) {
        if (this.audioPlayerData.key === key &&
            this.audioPlayerData.type === type &&
            this.audioPlayerData.item.song === item.song) { // Play/Pause current
            item.playing = !item.playing;
            this.playerService.setPlayTrack(this.audioPlayerData);
        }
        else { // Play new one
            this.audioPlayerData.list = data;
            this.audioPlayerData.item = item;
            this.audioPlayerData.key = key;
            /* this.audioPlayerData.user = this.userData.id;
            this.audioPlayerData.username = this.userData.username; */
            this.audioPlayerData.location = 'audios';
            this.audioPlayerData.type = type;
            this.audioPlayerData.selectedIndex = this.data.selectedIndex;
            this.playerService.setData(this.audioPlayerData);
            item.playing = true;
        }
    };
    // Item options
    AudiosComponent.prototype.itemSongOptions = function (type, item, playlist) {
        var _this = this;
        switch (type) {
            case ('addRemoveSession'):
                item.addRemoveSession = !item.addRemoveSession;
                item.removeType = item.addRemoveSession ? 'remove' : 'add';
                var dataARS = {
                    type: item.removeType,
                    location: 'session',
                    id: item.id
                };
                this.audioDataService.addRemove(dataARS)
                    .subscribe(function (res) {
                    // let song = item.original_title ? (item.original_artist + ' - ' + item.original_title) : item.title,
                    // 	text = !item.addRemoveSession ? (' ' + this.translations.common.hasBeenAdded) : (' ' + this.translations.common.hasBeenRemoved);
                    // this.alertService.success(song + text);
                }, function (error) {
                    _this.alertService.error(_this.translations.common.anErrorHasOcurred);
                });
                break;
            case ('addRemoveUser'):
                item.addRemoveUser = !item.addRemoveUser;
                item.removeType = item.addRemoveUser ? 'add' : 'remove';
                var dataARO = {
                    type: item.removeType,
                    location: 'user',
                    id: item.insertedId,
                    item: item.song
                };
                this.audioDataService.addRemove(dataARO)
                    .subscribe(function (res) {
                    item.insertedId = res;
                }, function (error) {
                    _this.alertService.error(_this.translations.common.anErrorHasOcurred);
                });
                break;
            case ('playlist'):
                item.removeType = !item.addRemoveUser ? 'add' : 'remove';
                var dataP = {
                    type: item.removeType,
                    location: 'playlist',
                    item: item.song,
                    playlist: playlist.idPlaylist
                };
                this.audioDataService.addRemove(dataP)
                    .subscribe(function (res) {
                    var song = item.original_title ? (item.original_artist + ' - ' + item.original_title) : item.title, text = ' ' + _this.translations.common.hasBeenAddedTo + ' ' + playlist.title;
                    _this.alertService.success(song + text);
                }, function (error) {
                    _this.alertService.error(_this.translations.common.anErrorHasOcurred);
                });
                break;
            case ('createPlaylist'):
                var dataCP = {
                    type: 'create',
                    item: item
                };
                this.sessionService.setDataCreatePlaylist(dataCP);
                break;
            case ('report'):
                item.type = 'audio';
                this.sessionService.setDataReport(item);
                break;
            case 'message':
                item.comeFrom = 'shareSong';
                this.sessionService.setDataNewShare(item);
                break;
            case 'newTab':
                var url = this.env.url + 's/' + item.name.slice(0, -4);
                this.window.open(url, '_blank');
                break;
            case 'copyLink':
                var urlExtension = this.env.url + 's/' + item.name.slice(0, -4);
                this.sessionService.setDataCopy(urlExtension);
                break;
        }
    };
